(29, 1, '2020-02-22 19:17:33', '2020-02-22 19:17:33', '<h2><em>Monstera Deliciosa </em>Overview</h2>\r\nThese climbing, evergreen perennials can reach up to 60 feet or more in height in their natural habitat. In your home, they can reach about eight feet in height. Their leaves alone can measure up to 2 feet long. Due to the impressive height of the <em>monstera deliciosa</em>, use a trellis or moist moss-covered sticks for support.\r\n\r\nA <em>monstera’s</em> uniquely shaped leaves allow it to withstand downpours in tropical rain forests. Its structure also helps it take in the few streaks of sunlight that make it to the rain forest floor. These characteristics are how it gained another nickname: the hurricane plant.\r\n\r\nThese <a class=\"qp_updated_link\" href=\"https://www.proflowers.com/category/BNP?ref=organicgglunkwn&amp;prid=pfseogglunkwn\" target=\"_blank\" rel=\"noopener noreferrer\">vibrant houseplants</a> look best in living and dining rooms where your guests can admire them for all their beauty. Keep in mind, these plants take up a lot of space. So just be sure there’s extra room wherever you’re planning on showing your new greenery off. As an added bonus, they also <a class=\"qp_updated_link\" href=\"https://www.proflowers.com/blog/best-plants-improve-air-quality?ref=organicgglunkwn&amp;prid=pfseogglunkwn\" target=\"_blank\" rel=\"noopener noreferrer\">purify the air</a>!', 'Monstera Deliciosa', 'Nicknamed the “swiss cheese plant,” the Monstera deliciosa is famous for its quirky natural leaf holes. A vibrant green beauty, it can give any interior space instant jungle vibes.', 'publish', 'open', 'closed', '', 'peperomia-obtusfolia', '', '', '2020-03-04 08:17:43', '2020-03-04 08:17:43', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=29', 0, 'product', '', 0),
