(36, 1, '2020-02-23 11:15:50', '2020-02-23 11:15:50', 'Rattlesnake plant, scientific name Calathea lancifolia, is a popular variety of the Calathea plants. It is great for those who wish to have a tropical vibe in their home. This is a great plant to grow for its magnificent foliage.\r\n\r\nJust like other varieties of Calathea plants, this one is a bit demanding. As such, it is not a perfect choice for beginner gardeners and those who want to spend less time caring for their plants. However, if you wish to invest some time and energy you will sure be rewarded. Rattlesnake plant is gorgeous and can truly improve the look of your home.\r\n\r\nA good thing about the Rattlesnake plant is that, while it can be a bit demanding, it is actually less demanding than other common Calathea varieties. It means this plant is suitable for those who want to grow a Calathea in their home but do not want to have a plant that is too demanding or difficult to care for.\r\n<h2>Basic Rattlesnake Plant Facts</h2>\r\nRattlesnake plant (Calathea lancifolia) is often sold under the name Calthea insignis, which is the plant’s former scientific name. Keep this in mind when you go shopping for a Rattlesnake plant in a nursery or garden center.\r\n\r\nThis plant is native to Brazil. In nature, Rattlesnake plant lives in warm and moist areas of the rainforest. It needs plenty of warmth and moisture to thrive. At the same time, it doesn’t do well in strong, direct light so this is something to keep in mind.', 'Calathea Rattlesnake', 'The Calathea Rattlesnake has long wavy green leaves with a pattern of deep green brushstrokes on top, resembling reptile skin, and a deep purple underside.', 'publish', 'open', 'closed', '', 'marble-queen-pothos', '', '', '2020-02-28 14:26:42', '2020-02-28 14:26:42', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=36', 0, 'product', '', 0),
(38, 1, '2020-02-23 11:22:47', '2020-02-23 11:22:47', '<h2 class=\"guide_intro\">Palms are robust, low maintenance, and a classic addition to any plant collection. Though Palms are unmistakably tropical, their elegant fronds will complement any decor. Palms tend to grow slowly, so you don’t need to worry about them outgrowing their spot too quickly.</h2>', 'Parlor Palm', '<p class=\"product__description\">The Parlor Palm is a favorite easy-care palm with tropical fronds known for its air purifying qualities.</p>', 'publish', 'open', 'closed', '', 'birds-nest-fern', '', '', '2020-02-28 14:45:09', '2020-02-28 14:45:09', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=38', 0, 'product', '', 0),
(40, 1, '2020-02-23 11:39:44', '2020-02-23 11:39:44', '<b>Philodendron</b> care is simple, as the <b>plant</b> can readily adapt to any <b>indoor</b> environment. It can thrive <b>indoors</b> year round, and grows well in a west or southeast window. Light: <b>Philodendrons</b> grow <b>best</b> in medium light and bright indirect sunlight. ... Take care not to overwater, since <b>philodendron</b> will rot if kept soggy.', 'Philodendron Green', 'Why is the Philodendron our most popular plant? From its heart-shaped vibrant green leaves, to its easy-going nature, to its quick-growing trailing vines – the Philodendron is the quintessential houseplant every budding plant parent needs.', 'publish', 'open', 'closed', '', 'philodendron-green', '', '', '2020-02-28 18:58:40', '2020-02-28 18:58:40', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=40', 0, 'product', '', 0),
(42, 1, '2020-02-23 11:43:49', '2020-02-23 11:43:49', 'If you\'re looking for an easy-care houseplant, you can\'t do much better than snake plant. This hardy indoor is still popular today. Most snake plant varieties have stiff, upright, sword-like leaves that may be banded or edged in gray, silver, or gold. Snake plant\'s architectural nature makes it a natural choice for modern and contemporary interior designs. It\'s one of the best houseplants around!\r\n\r\nNote: Snake plant can be invasive when planted outdoors in some frost-free areas; check local restrictions before putting it in your landscape.', 'Snake Plant Laurentii', 'The Snake Plant Laurentii is a succulent plant characterized by its upright swordlike leaves with vibrant yellow edges.', 'publish', 'open', 'closed', '', 'snake-plant-laurentii', '', '', '2020-03-03 12:08:51', '2020-03-03 12:08:51', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=42', 0, 'product', '', 0),
(43, 0, '2020-02-23 12:41:32', '2020-02-23 12:41:32', '[]', 'wc_admin_unsnooze_admin_notes', '', 'publish', 'open', 'closed', '', 'scheduled-action-5e52aef6cc6d71.79314112-vWgVW6HcX4jRKsWT1OvMCCRctAC6oI98', '', '', '2020-02-23 16:57:26', '2020-02-23 16:57:26', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=scheduled-action&#038;p=43', 0, 'scheduled-action', '', 3),
(46, 1, '2020-02-23 11:49:49', '2020-02-23 11:49:49', 'These are very easy to grow and can make a good plant choice for the beginner. Keeping to the basics of care instructions will allow these plants to thrive. Most important is enough light, no overwatering or cold conditions.\r\n\r\nIn their natural habitat they reside undercover within forests with some sun and shade so we need to try and replicate this. Sitting back from a west, east or even south facing window is best.\r\n\r\nIt\'s important not to water these plants too much or underwater them. Over-watering can cause rot and under-watering will make them wilt. To get watering just about right, allow the soil to dry to the touch at the top and then water thoroughly, but much less during winter.', 'Faux Watermelon Peperomia', 'No green thumb required to keep our artificial watermelon peperomia plant looking lively and lush anywhere you place it. It\'s paired with one of our ceramic pots for a realistic look.', 'publish', 'open', 'closed', '', 'faux-watermelon-peperomia', '', '', '2020-03-03 12:08:21', '2020-03-03 12:08:21', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=46', 0, 'product', '', 0),
(48, 1, '2020-02-28 14:47:53', '2020-02-28 14:47:53', 'These are very easy to grow and can make a good plant choice for the beginner. Keeping to the basics of care instructions will allow these plants to thrive. Most important is enough light, no overwatering or cold conditions.\n\nIn their natural habitat they reside undercover within forests with some sun and shade so we need to try and replicate this. Sitting back from a west, east or even south facing window is best.\n\nIt\'s important not to water these plants too much or underwater them. Over-watering can cause rot and under-watering will make them wilt. To get watering just about right, allow the soil to dry to the touch at the top and then water thoroughly, but much less during winter.', 'Faux Watermelon Peperomia', 'No green thumb required to keep our artificial watermelon peperomia plant looking lively and lush anywhere you place it. It\'s paired with one of our ceramic pots for a realistic look.', 'inherit', 'closed', 'closed', '', '46-autosave-v1', '', '', '2020-02-28 14:47:53', '2020-02-28 14:47:53', '', 46, 'http://localhost/zh-wp-projects/zheshop/2020/02/23/46-autosave-v1/', 0, 'revision', '', 0),
(49, 1, '2020-02-23 11:56:05', '2020-02-23 11:56:05', '<p id=\"lR95D8\">i, I’m glad you’re here!  I received so many questions from all of you after my last Pilea post (<a href=\"https://cleverbloom.com/care-pilea-peperomioides/\" target=\"_blank\" rel=\"noopener noreferrer\">How to care for Pilea Peperomioides</a>) where my dear friend Morgan shared her expertise on the subject.  That post is so Amazing!!  But today I’m going to answer some of your questions and help you troubleshoot some of your problems.  A lot of these questions I wondered myself.  After some research, talking to my plant friends and getting to know my plants I was able to come up with these answers.  Here we go! (I’m just going to call it Pilea from here on so it’s less typing for me.  Ha!)</p>', 'Faux Pilea Peperomioides', 'No window required with to keep this trendy coin plant alive. Place our artificial Pilea Peperomioides in any room of your home. Pair it with one of our ceramic pots for a realistic look.', 'publish', 'open', 'closed', '', 'faux-pilea-peperomioides', '', '', '2020-02-28 14:56:45', '2020-02-28 14:56:45', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=49', 0, 'product', '', 0),
(51, 1, '2020-02-23 12:02:35', '2020-02-23 12:02:35', 'Shades of purple and green make these Wax Begonia leaves pop with color. The tightly packed leaves give the bush a full,flourishing look. Place the set of six in decorative planters or add to an arrangement for an eye-catching contrast with flowers.', 'Faux Rex Begonia', '<p class=\"product__description\">Our artificial Rex Begonia gives your space a long-lasting pop of color with vibrant purple veining and a slight iridescent sheen.Pair it with one of our ceramic pots for a realistic look.</p>', 'publish', 'open', 'closed', '', 'faux-rex-begonia', '', '', '2020-02-28 18:51:25', '2020-02-28 18:51:25', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=51', 0, 'product', '', 0),
(53, 1, '2020-02-23 12:12:18', '2020-02-23 12:12:18', 'This plant will add a bright spot to any room. The color will never fade, it’s clean, easy to maintain and will last forever. It will change the color and feel of a room and make a beautiful and lasting gift.', 'Faux Monstera', 'No green thumb required to keep our large artificial monstera houseplant happy and healthy. Pair it with one of our ceramic floor planters for a more polished look.', 'publish', 'open', 'closed', '', 'faux-monstera-leaves', '', '', '2020-02-28 18:54:07', '2020-02-28 18:54:07', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=53', 0, 'product', '', 0),
