(62, 1, '2020-02-28 14:31:53', '2020-02-28 14:31:53', 'The parlor palm is the quintessential houseplant – the proof is right in the name. Growing a parlor palm tree indoors is ideal because it grows very slowly and thrives in low light and cramped space. It’s also an excellent air purifier. Keep reading to learn how to care for a parlor palm plant.\n\nRead more at Gardening Know How: Parlor Palm Houseplants: How To Care For A Parlor Palm Plant <a href=\"https://www.gardeningknowhow.com/houseplants/parlor-palm/parlor-palm-houseplants.htm\">https://www.gardeningknowhow.com/houseplants/parlor-palm/parlor-palm-houseplants.html</a>\n\nParlor Palm Houseplants Growing an indoor parlor palm is very easy and gratifying. Parlor palm houseplants prefer low light and may actually suffer in direct sunlight, so there’s no need to place them in your brightest windows. They do like a little bit of light, and will do best by a window that receives some early morning or late afternoon light.\n\nRead more at Gardening Know How: Parlor Palm Houseplants: How To Care For A Parlor Palm Plant <a href=\"https://www.gardeningknowhow.com/houseplants/parlor-palm/parlor-palm-houseplants.htm\">https://www.gardeningknowhow.com/houseplants/parlor-palm/parlor-palm-houseplants.htm</a>', 'Parlor Palm', '<p class=\"product__description\">The Parlor Palm is a favorite easy-care palm with tropical fronds known for its air purifying qualities.</p>', 'inherit', 'closed', 'closed', '', '38-autosave-v1', '', '', '2020-02-28 14:31:53', '2020-02-28 14:31:53', '', 38, 'http://localhost/zh-wp-projects/zheshop/2020/02/23/38-autosave-v1/', 0, 'revision', '', 0),
