(64, 1, '2020-02-23 17:32:50', '2020-02-23 17:32:50', 'The Money Tree is also called the “Good Luck Tree” and is an age-old token of good luck and an invitation to good fortune. It creates positive energy and rumored to bring prosperity and wealth to your surroundings. Resilient and does not require much care. The Money Tree is hardy and extremely tolerant of low light and dryness.\r\n\r\n<b>Should</b> not be over-watered, two to three times a month is sufficient. It is permissible to allow the top layer of soil to dry out to about an inch in between waterings.\r\n\r\nThe Money Tree will thrive indoors in high light and appreciates being kept outdoors during the spring and summer. When night time temperatures drop below 45 degrees we suggest that you place the tree on a windowsill or on a table in front of one.', 'Money Tree Plant', 'The Money Tree is a popular houseplant because of its resilience, ease of growth, and fun braided trunk.', 'publish', 'open', 'closed', '', 'money-tree-plant', '', '', '2020-03-04 08:16:59', '2020-03-04 08:16:59', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=64', 0, 'product', '', 0),
