(71, 1, '2020-02-28 18:50:23', '2020-02-28 18:50:23', 'Flowers have been adorning our homes since ancient times and nothing quite completes a home or office as perfectly as a touch of floral. Perfectly replicated fake Silk Begonia plants and flowers are a great way to keep your environment warm, cozy and welcoming the whole year through. It’s so simple to just drop some Silk Begonia Flowers into a vase and create the balanced ambiance your unconscious is always searching for. Nearly Natural offers a beautiful array of silk flowers perfect for just about any space.', 'Faux Rex Begonia', '<p class=\"product__description\">Our artificial Rex Begonia gives your space a long-lasting pop of color with vibrant purple veining and a slight iridescent sheen.Pair it with one of our ceramic pots for a realistic look.</p>', 'inherit', 'closed', 'closed', '', '51-autosave-v1', '', '', '2020-02-28 18:50:23', '2020-02-28 18:50:23', '', 51, 'http://localhost/zh-wp-projects/zheshop/2020/02/23/51-autosave-v1/', 0, 'revision', '', 0);
