(79, 1, '2020-02-24 13:16:03', '2020-02-24 13:16:03', 'Wood plant stand brings that extra flair to your indoor plants.\r\n\r\nThese hand crafted plant stands are crafted and designed to bring a modern bohemian touch to your home. Oh, and did we mention these are environmentally friendly, too? What a deal!\r\n\r\nWe offer several sizes and stains.\r\n\r\nGorgeous, modern plant stand for any room. Wood legs and 8 inch white ceramic planter included. The stand pictured is 25.5 inches from the bottom to the top of the white planter. Planter is 8 inches and full diameter of stand is 11.5 inches. We are always happy to build for custom dimensions, so just leave a note in the personalization if you want a different height or diameter.', 'Plant Stand', 'Our classic mid century Plant Stand is made from eco-friendly rubberwood, a light-colored tropical hardwood from the Pará rubber tree. It has a clear top coating and measures 14.3\" wide by 17.3\" tall (wood is .9\" thick). Fits 12\" diameter planter. Ships flat.', 'publish', 'open', 'closed', '', 'plant-stand', '', '', '2020-02-28 18:40:25', '2020-02-28 18:40:25', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=79', 0, 'product', '', 0),
