(81, 1, '2020-02-24 13:21:48', '2020-02-24 13:21:48', 'If you have a Grandma that loves gardening or being outside, this is THE BEST Mothers day gift that she can get. An adorable plant stick that will remind her over and over again just how much you love and adore her. This hand scripted stick is designed for planters but can also be stuck into a cake or dessert of choice too.\r\n\r\nMake any <em>plant</em> a gift with the right <em>message</em>. Personalize your gift by choosing between six <em>messages</em> screen\r\n\r\nDesign pot plant stakes. Buy some plain stakes or use wooden sticks. Children can write out a message on some cardboard using a glitter pen. Use glue or strong tape to attach the message to the stake, then plant this in the pot.', 'Ceramic Message Pops', '<p class=\"product__description\">Make any plant a gift with the right message. Personalize your gift by choosing between six messages screen printed in black on 3 different shapes. Ceramic head measuring 1.37\" tall is attached to wooden stick measuring about 4.3\" tall. Message Pop is packaged separately to protect pop and plant during transit.</p>', 'publish', 'open', 'closed', '', 'ceramic-message-pops', '', '', '2020-02-28 18:33:11', '2020-02-28 18:33:11', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=81', 0, 'product', '', 0),
(82, 1, '2020-02-24 13:19:08', '2020-02-24 13:19:08', 't can be difficult to provide enough light to your houseplants due to seasonal changes or lack of window space. See these pointers on how to choose the best indoor lighting for your plants.\r\n\r\nThe two main <b>types</b> of fluorescent <b>lights</b> used for growing <b>plants</b> are the tube-style <b>lights</b> and compact fluorescent <b>lights</b>.', 'Grow Light', 'Does your space not get enough sunlight? Give your plant babies the TLC they deserve with this innovative grow light. It offers a highly precise photosynthetic spectrum. We recommend the Small (20 watt, 2000 lumens, 4.35 lbs, 5.8\" tall by 3.8\" wide) for small to medium houseplants and the Large (40 watt, 4000 lumens, 4.7 lbs, 7\" tall by 4\" wide) for medium to large houseplants. Both sizes will last for about 15 years, if used for an average of 16 hours a day. Each grow light includes: LED grow light, 15ft fabric cord, an outlet timer, 3 pack of ceiling hooks, 2 wall fairleads, 1 swag hook, and an instruction guide.', 'publish', 'open', 'closed', '', 'grow-light', '', '', '2020-02-28 18:35:02', '2020-02-28 18:35:02', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=82', 0, 'product', '', 0),
