(85, 1, '2020-02-24 13:24:39', '2020-02-24 13:24:39', 'Using self-watering containers can be the best way to grow some plants. Plant health increases by providing a consistent level of moisture directly to the roots of plants. Probably the most common mistakes gardeners make is to <a href=\"https://www.thespruce.com/watering-plants-in-containers-847785\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"internalLink\" data-ordinal=\"1\">over-water plants</a>. With a well-designed self-watering container, the plants will get just the amount of water they need to thrive.\r\n\r\nSelf-watering containers are also the perfect solution if you travel and can\'t keep up with the <a href=\"https://www.thespruce.com/tips-for-watering-houseplants-1902807\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"internalLink\" data-ordinal=\"1\">watering needs</a> of your plants. They also work well if you have a place where you want a container, but its location makes it awkward or difficult to water.\r\n\r\n&nbsp;', 'Watering Can', 'Small BPA-free plastic watering can in green with long stem spout to control water flow. Holds 56 oz of water (about 1/2 gallon). Great for watering indoor plants but durable enough for outdoor use as well. Embossed with leafy plant motif. Made in the USA.', 'publish', 'open', 'closed', '', 'watering-can', '', '', '2020-02-28 18:19:59', '2020-02-28 18:19:59', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=85', 0, 'product', '', 0),
