(87, 1, '2020-02-24 13:27:00', '2020-02-24 13:27:00', '<b>Outdoor potting soil</b> and <b>indoor potting soil</b> are essentially the same things. They both contain key nutrients that your plants need. The main <b>difference</b> is simply <b>in the</b> labeling of the product. Certain plants can really only grow well <b>outdoors</b>, like fruit trees and shrubs.', 'Potting Supplies Trio', 'The Sill’s potting supplies trio is here for all your potting needs. It includes one 1.5 pound bag of each of the following: Potting Mix, Cacti Mix, Lava Rocks. All natural. Potting mix ingredients: compost, pine bark, coir, worm castings, perlite. Cacti mix ingredients: biochar, expanded shale, rice hulls, compost, warm castings, sand, coir. Lava rocks ingredients: just lava rocks.', 'publish', 'open', 'closed', '', 'potting-supplies-trio', '', '', '2020-03-03 12:05:14', '2020-03-03 12:05:14', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=87', 0, 'product', '', 0),
