(89, 1, '2020-02-24 13:36:36', '2020-02-24 13:36:36', 'Once you have <b>the gift card</b> number (or as much information as you <b>can find</b>), call customer service for <b>the</b> merchant that issued <b>the gift card</b>. ... <b>The</b> objective of <b>the</b> phone call is not to “<b>find</b>” <b>the gift card</b>, but to <b>find out</b> if <b>the gift card</b> has been <b>used</b>.', 'Digital Gift Card', 'Can’t decide? Give the gift of their choosing with a Digital Gift Card. Our e-gift is delivered by email with instructions on how to redeem. Forward to the recipient directly from your e-mail inbox, or replace your email with theirs during checkout. No additional processing or shipping fees. <a href=\"https://www.thesill.com/pages/gift-card-terms-conditions\">Find gift card T&amp;C\'s here.</a>', 'publish', 'open', 'closed', '', '89', '', '', '2020-03-03 12:04:59', '2020-03-03 12:04:59', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=89', 0, 'product', '', 0),
(90, 1, '2020-02-24 13:39:29', '2020-02-24 13:39:29', 'Sweetheart hoya plant is a type of Hoya appropriately named for its thick, succulent, heart-shaped leaves. Like other Hoya varieties, sweetheart hoya plant is a stunning, low-maintenance indoor plant. Although the plant is relatively slow-growing, it appreciates a hanging basket where it eventually becomes a bushy mass of green hearts. Mature plants can reach lengths of up to 13 feet. One mature plant can display up to 25 blooms.\r\n\r\nThe good news is that your leaf/plant is extremely easy to care for. They like to live in bright sun (but can tolerate bright indirect light) in a well-drained pot, and don’t need tons of water. Water every two or three weeks, or when soil is completely dry and the leaves start to wrinkle.', 'Hoya Heart Plant', 'This Hoya kerrii cutting is commonly referred to as the Hoya Heart because of its heart-shaped leaf. The leaf is partially rooted.', 'publish', 'open', 'closed', '', 'hoya-heart-plant', '', '', '2020-03-03 12:04:21', '2020-03-03 12:04:21', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=90', 0, 'product', '', 0),
