(97, 1, '2020-02-28 14:42:46', '2020-02-28 14:42:46', 'If you\'re looking for an easy-care houseplant, you can\'t do much better than snake plant. This hardy indoor is still popular today. Most snake plant varieties have stiff, upright, sword-like leaves that may be banded or edged in gray, silver, or gold. Snake plant\'s architectural nature makes it a natural choice for modern and contemporary interior designs. It\'s one of the best houseplants around!\n\nNote: Snake plant can be invasive when planted outdoors in some frost-free areas; check local restrictions before putting it in your landscape.', 'Snake Plant Laurentii', 'The Snake Plant Laurentii is a succulent plant characterized by its upright swordlike leaves with vibrant yellow edges.', 'inherit', 'closed', 'closed', '', '42-autosave-v1', '', '', '2020-02-28 14:42:46', '2020-02-28 14:42:46', '', 42, 'http://localhost/zh-wp-projects/zheshop/2020/02/24/42-autosave-v1/', 0, 'revision', '', 0),
(98, 1, '2020-02-24 17:33:59', '2020-02-24 17:33:59', 'Sometimes blank note cards are just what you need to communicate your most heartfelt thoughts. Our collection will give you the creative freedom to tell your nearest and dearest whatever your heart desires from “I miss you” to “Congratulations!”\r\n\r\nWrite your sweetest sentiments whenever you wish with boxed note cards from PAPYRUS. With so many different styles and designs to choose from, you\'ll definitely find one that fits your taste. We believe in taking advantage of every opportunity to send a card and celebrate the joy of everyday! We want to remind you to embrace all that life has to offer and appreciate the little things.\r\n\r\n&nbsp;\r\n\r\nOur mission is to elevate everyday living and moments in that journey to become joyful events, visual statements, and objects of beauty that convey a sense of self and punctuate the way we experience life. You\'ll always be prepared to spread the love with our beautiful blank note cards. Little notes make life just a little sweeter. Make someone smile today with PAPYRUS.\r\n\r\n&nbsp;', 'Potted Plants Boxed Notes', 'Potted Plants Boxed Notes include 2 each of 4 plant-themed designs, and feature gold foil and matching envelopes.', 'publish', 'open', 'closed', '', 'potted-plants-boxed-notes', '', '', '2020-02-28 15:49:00', '2020-02-28 15:49:00', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=98', 0, 'product', '', 0),
(100, 1, '2020-02-24 17:26:16', '2020-02-24 17:26:16', 'Apps aren\'t everything. Despite the plethora of to-do apps and note-taking apps available, pen and paper can still be a valuable productivity tool.\r\n\r\nYou don\'t necessarily have to choose one approach or the other. Both apps and paper notebooks have particular advantages, and it\'s possible to combine them into one awesome, productivity-producing system of your own.', 'Weekly Planner and Note Cards', '<p class=\"product__description\">Weekly Planner + Note Cards by Angela Staehling. This weekly planner features 55 easy tear-off sheets to let you plan your year, one week at a time. This dateless notepad includes an attachable magnetic strip. Pad measures 9\" x 6-1/4\". Note cards are packaged in a clear protective plastic box and include 10 blank note cards and 10 white envelopes. Card size is 4.125\" x 5.5\".</p>', 'publish', 'open', 'closed', '', 'weekly-planner-and-note-cards', '', '', '2020-02-28 16:00:50', '2020-02-28 16:00:50', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=100', 0, 'product', '', 0),
(101, 1, '2020-02-24 17:30:25', '2020-02-24 17:30:25', 'A <b>coaster</b> is an item used to rest <a title=\"Drink\" href=\"https://en.wikipedia.org/wiki/Drink\">drinks</a> upon. It protects the surface of a <a title=\"Table (furniture)\" href=\"https://en.wikipedia.org/wiki/Table_(furniture)\">table</a> or any other surface where the user might place a drink. They are placed on top of a beverage can also be used to show that a drink is not finished or to prevent contamination (usually from insects). Coasters can also stop hot drinks burning the table surface.\r\n\r\nMany coasters have a picture on the side that is the upside.', 'Illustrated Coaster Set', 'Coaster Set by Angela Staehling. This coaster set features six assorted round coasters with cork backing, are heat and water resistant, and will withstand years of use. Packaged within a beautiful gold hot foil stamped box, this set is ideal for gifting.', 'publish', 'open', 'closed', '', 'illustrated-coaster-set', '', '', '2020-02-28 15:53:40', '2020-02-28 15:53:40', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=101', 0, 'product', '', 0),
