(106, 1, '2020-02-24 17:38:00', '2020-02-24 17:38:00', '<b>Adding a plant or two on a shelf is a good idea</b>, no it’s an excellent idea! Whether it’s a  prickly cactus, fleshy succulents or sculptural hanging plants – play around and see the magic unfold before your eyes. Since my shelf is a bit compact I’ve decided to dedicate a full shelf only for some decorative items and stuff all books on the other shelf. My current <b>mood is very earthy, balanced, vintage</b>. I chose my paddle plant and a cactus to add the green factor. I paired the plants with some vintage ceramics in earthy tones, a wooden candleholder.', 'Plant Shelfie Prints (Set of 4)', 'Plant Shelfie Prints (Set of 4, frames not included) by Angela Staehling. This little set of gouache and pencil paintings captures Angela’s love of plants, coffee, and travel. The 5\" x 7\" prints from her Plant Life collection are printed on natural watercolor 100% cotton paper. She also sells each print individually for $15 (see individual listings).', 'publish', 'open', 'closed', '', 'plant-shelfie-prints-set-of-4', '', '', '2020-02-28 15:41:49', '2020-02-28 15:41:49', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=106', 0, 'product', '', 0),
