(109, 1, '2020-02-24 17:58:00', '2020-02-24 17:58:00', 'A lot of oil and natural gas go into the production of plastic <b>bags</b>, which are not recyclable. Choosing <b>reusable bags</b> saves on these non-renewable resources and protects the <b>environment</b>. Even if you use paper <b>bags</b>, it costs money to recycle them.', 'Ask Me About My Plants', 'Our Ask Me About My Plants canvas tote bag is 15.75\" tall x 17.75\" wide x 6.25\" deep, with graphics in green on both sides. Gusset bottom. 100% cotton canvas. Washer machine safe, lay flat to air dry. Do not iron. Wear with pride.', 'publish', 'open', 'closed', '', 'ask-me-about-my-plants', '', '', '2020-02-28 15:39:32', '2020-02-28 15:39:32', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=109', 0, 'product', '', 0),
(110, 1, '2020-02-24 18:02:46', '2020-02-24 18:02:46', 'Cloth bags have become a popular alternative to plastic and paper shopping bags. Cloth bags do not cause the environmental harm of plastic bags. However, cloth bags are not only for the environmentally-conscious consumer. Unlike the free bagging alternatives, cloth bags usually come with a nominal price tag, but the advantages of reusing cloth bags outweigh this small cost.', 'Plants Make People Happy', 'Our black Plants Make People Happy tote bag is 12\" tall and 12\" wide, with graphics in white on one side. Machine wash. Wear with pride.', 'publish', 'open', 'closed', '', 'plants-make-people-happy', '', '', '2020-02-28 15:38:55', '2020-02-28 15:38:55', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=110', 0, 'product', '', 0),
(111, 1, '2020-02-24 18:05:56', '2020-02-24 18:05:56', '<b>Monstera Earrings</b>. These <b>earrings</b> are inspired by the leaf of one of the artist\'s favorite plants, <b>Monstera</b> Deliciosa — also known as the swiss cheese plant. This shape is light and easy to wear. The profile is rounded and at first glance looks almost like a simple hoop <b>earring</b>.', 'Monstera Earrings', 'These earrings are inspired by the leaf of one of the artist’s favorite plants, Monstera Deliciosa — also known as the swiss cheese plant. This shape is light and easy to wear. The profile is rounded and at first glance looks almost like a simple hoop earring. Upon closer examination, the delicate interior details set it apart from the norm. These are sold as a pair. They are 2.5\" x 1.5\" and available in sterling silver or 14k gold fill. All items are hand made to order, thus each varies slightly and is beautiful in its own way.', 'publish', 'open', 'closed', '', 'monstera-earrings', '', '', '2020-02-28 15:35:50', '2020-02-28 15:35:50', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=111', 0, 'product', '', 0),
(112, 1, '2020-02-24 18:08:26', '2020-02-24 18:08:26', '<b>Hard enamel pins</b> are die-struck <b>pins</b> with color applied using a small brush or needle. Thin metal lines separate each of the colors on your <b>pin</b>. <b>Hard enamel pins</b> are heated to a high temperature and then polished, creating a bright, smooth, <b>hard enamel</b> finish.', 'Pins', 'et of two exclusive hard enamel pins, Plants Make People Happy pin measuring about 1\" wide x 1.2\" tall and My Plants Understand Me pin measuring about 0.62\" wide x 1.65\" tall. Both are green on silver plate with rubber stoppers on back. Wear with pride as a set, or give one to your best plant pal.', 'publish', 'open', 'closed', '', 'pins', '', '', '2020-02-28 15:34:34', '2020-02-28 15:34:34', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=112', 0, 'product', '', 0),
