(118, 1, '2020-02-24 18:16:30', '2020-02-24 18:16:30', '<b>Face masks</b> are the perfect skin care treatment to help you with your skin care concerns. The right <b>face mask</b> can help hydrate skin, remove excess oils and help improve the appearance of your pores. They\'re also an excellent way to help pull out impurities', 'Clean Greens Face Mask', 'This powder-to-gel 1 oz. face mask is made in the USA by the female-founded company Golde. Basically a green smoothie for your skin, it\'s vegan, cruelty-free and is made of all organic ingredients- mango juice powder, marshmallow root extract, spirulina powder, chlorella powder. To use: Mix 1 tsp mask powder with a few drops of water for a creamy-gel consistency. Apply a thin, even layer to face for 10-15 minutes. Gently rinse with water to remove. Apply up to 3 times weekly.', 'publish', 'open', 'closed', '', 'clean-greens-face-mask', '', '', '2020-03-03 12:03:52', '2020-03-03 12:03:52', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=118', 0, 'product', '', 0),
(119, 1, '2020-02-24 18:20:15', '2020-02-24 18:20:15', 'Organic and natural products are coming out of the shadow of mainstream beauty preparations. Both women and men are more frequently choosing not to apply products with chemicals and possible noxious toxins. Instead, they are opting to only use pure organic/natural preparations.\r\n\r\nArtificial scents can create headaches, congestion, and nasal and skin irritation. Natural skincare products only smell like their natural ingredients that provide the additional benefit of aromatherapy.', 'Philodendron & Clean Greens Face Mask', '', 'publish', 'open', 'closed', '', 'philodendron-clean-greens-face-mask', '', '', '2020-02-28 15:24:50', '2020-02-28 15:24:50', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=119', 0, 'product', '', 0),
(120, 1, '2020-02-24 18:24:04', '2020-02-24 18:24:04', '<h2><em>Monstera Deliciosa </em>Overview</h2>\r\nThese climbing, evergreen perennials can reach up to 60 feet or more in height in their natural habitat. In your home, they can reach about eight feet in height. Their leaves alone can measure up to 2 feet long. Due to the impressive height of the <em>monstera deliciosa</em>, use a trellis or moist moss-covered sticks for support.\r\n\r\nA <em>monstera’s</em> uniquely shaped leaves allow it to withstand downpours in tropical rain forests. Its structure also helps it take in the few streaks of sunlight that make it to the rain forest floor. These characteristics are how it gained another nickname: the hurricane plant.\r\n\r\nThese <a class=\"qp_updated_link\" href=\"https://www.proflowers.com/category/BNP?ref=organicgglunkwn&amp;prid=pfseogglunkwn\" target=\"_blank\" rel=\"noopener noreferrer\">vibrant houseplants</a> look best in living and dining rooms where your guests can admire them for all their beauty. Keep in mind, these plants take up a lot of space. So just be sure there’s extra room wherever you’re planning on showing your new greenery off. As an added bonus, they also <a class=\"qp_updated_link\" href=\"https://www.proflowers.com/blog/best-plants-improve-air-quality?ref=organicgglunkwn&amp;prid=pfseogglunkwn\" target=\"_blank\" rel=\"noopener noreferrer\">purify the air</a>!', 'Monstera & Clean Greens Face Mask', '', 'publish', 'open', 'closed', '', 'monstera-clean-greens-face-mask', '', '', '2020-02-28 14:18:30', '2020-02-28 14:18:30', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=120', 0, 'product', '', 0),
