(485, 1, '2020-02-28 14:48:58', '2020-02-28 14:48:58', '<p id=\"lR95D8\"><strong>What it is: </strong>A hardy plant, called Pilea peperomioides<em>,</em> that once grew on rocks in the shade in the southwestern Yunnan province of China. It grows about a foot tall and forms orbs of brightly verdant round leaves. Now it’s rare in its native habitat but everywhere in homes.</p>\n<p id=\"QS9q5X\"><strong>Where it is: </strong>About two years ago, plant enthusiasts could only get Pilea peperiomiodes cuttings from their friends or personal growers on Instagram or Etsy. Gradually, trendy plant delivery services began to acquire them from regional nurseries. Now, big-box retailers like Home Depot, Walmart, and Amazon sell these plants, as well as direct-to-consumer plant outlets like the Sill. They appear in <a href=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.anthropologie.com%2Fshop%2Fmarnie-pot%3Fcategory%3Dgarden-outdoor%26color%3D102&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves%3FsubId1%3Dxid%3Afr1582901313584ghg&amp;xcust=xid:fr1582901313584ghg\" target=\"_blank\" rel=\"nofollow noopener noreferrer\" data-orig-url=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.anthropologie.com%2Fshop%2Fmarnie-pot%3Fcategory%3Dgarden-outdoor%26color%3D102&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves\" data-ml-id=\"3\" data-ml=\"true\" data-xid=\"fr1582901313584ghg\">Anthropologie</a> and <a href=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.urbanoutfitters.com%2Fshop%2Fsita-6-textured-planter%3Fcategory%3Dterrariums-indoor-planters%26color%3D012%26type%3DREGULAR&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves%3FsubId1%3Dxid%3Afr1582901313585aac&amp;xcust=xid:fr1582901313585aac\" target=\"_blank\" rel=\"nofollow noopener noreferrer\" data-orig-url=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.urbanoutfitters.com%2Fshop%2Fsita-6-textured-planter%3Fcategory%3Dterrariums-indoor-planters%26color%3D012%26type%3DREGULAR&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves\" data-ml-id=\"4\" data-ml=\"true\" data-xid=\"fr1582901313585aac\">Urban Outfitters</a> planter ads, and <a href=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.ikea.com%2Fus%2Fen%2Fcatalog%2Fproducts%2F50395315%2F%3Fgclid%3DCj0KCQjwpsLkBRDpARIsAKoYI8yrDPYbtth5LTTkJHZEdLCdP_T2ixZjoBSDswdBkJDPzTZPiB6K_asaAkTlEALw_wcB&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves%3FsubId1%3Dxid%3Afr1582901313585ghi&amp;xcust=xid:fr1582901313585ghi\" target=\"_blank\" rel=\"nofollow noopener noreferrer\" data-orig-url=\"https://go.redirectingat.com/?id=66960X1516588&amp;xs=1&amp;url=https%3A%2F%2Fwww.ikea.com%2Fus%2Fen%2Fcatalog%2Fproducts%2F50395315%2F%3Fgclid%3DCj0KCQjwpsLkBRDpARIsAKoYI8yrDPYbtth5LTTkJHZEdLCdP_T2ixZjoBSDswdBkJDPzTZPiB6K_asaAkTlEALw_wcB&amp;referrer=vox.com&amp;sref=https%3A%2F%2Fwww.vox.com%2Fthe-goods%2F2019%2F3%2F21%2F18274568%2Fpilea-peperomioides-plant-instagram-sill-circular-leaves\" data-ml-id=\"5\" data-ml=\"true\" data-xid=\"fr1582901313585ghi\">Ikea</a> sells a fake version<em>. </em>They’re featured on the accounts of #plantfluencers like <a href=\"https://www.instagram.com/hiltoncarter/?hl=en\">Hilton Carter</a>, <a href=\"https://www.instagram.com/cleverbloom/\">Erin Harding</a>, and <a href=\"https://www.instagram.com/plantingpink/\">Morgan Doane</a>.</p>\n<p id=\"414U2C\"><strong>Why you’re seeing it everywhere:</strong> The scarcity-driven social media hype has continued even as the Pilea peperomioides has reached mainstream availability, in part because they’re tough but distinctive houseplants. The plants grow and reproduce quickly, sprouting small pups in the surrounding soil. They’ve evolved to prefer a dry and shady habitat, which fits the description of most modern homes. They aren’t toxic to children or animals and are easy to recognize in a houseplant lineup.</p>', 'Faux Pilea Peperomioides', 'No window required with to keep this trendy coin plant alive. Place our artificial Pilea Peperomioides in any room of your home. Pair it with one of our ceramic pots for a realistic look.', 'inherit', 'closed', 'closed', '', '49-autosave-v1', '', '', '2020-02-28 14:48:58', '2020-02-28 14:48:58', '', 49, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/49-autosave-v1/', 0, 'revision', '', 0),
(486, 1, '2020-02-28 15:10:55', '2020-02-28 15:10:55', 'This nourishing face mask is made with 100% pure plants, it\'s basically a green smoothie for your skin.\n\nPacked with natural chlorophyll, the powder-to-gel formula gently detoxifies while delivering key nutrients to promote clear, glowing skin.\n\nApply a thin, even layer to face for 10-15 minutes. Gently rinse with water to remove. Apply up to 3 times weekly.\n<p class=\"bold pb4\">Ingredients: Mango juice powder*, marshmallow root extract*, spirulina powder*, chlorella powder*</p>', 'Clean Greens Face Mask', 'This powder-to-gel 1 oz. face mask is made in the USA by the female-founded company Golde. Basically a green smoothie for your skin, it\'s vegan, cruelty-free and is made of all organic ingredients- mango juice powder, marshmallow root extract, spirulina powder, chlorella powder. To use: Mix 1 tsp mask powder with a few drops of water for a creamy-gel consistency. Apply a thin, even layer to face for 10-15 minutes. Gently rinse with water to remove. Apply up to 3 times weekly.', 'inherit', 'closed', 'closed', '', '118-autosave-v1', '', '', '2020-02-28 15:10:55', '2020-02-28 15:10:55', '', 118, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/118-autosave-v1/', 0, 'revision', '', 0),
(487, 1, '2020-02-28 15:23:02', '2020-02-28 15:23:02', 'Organic and natural products are coming out of the shadow of mainstream beauty preparations. Both women and men are more frequently choosing not to apply products with chemicals and possible noxious toxins. Instead, they are opting to only use pure organic/natural preparations.\n\nArtificial scents can create headaches, congestion, and nasal and skin irritation. Natural skincare products only smell like their natural ingredients or natural essential oils that provide the additional benefit of aromatherapy.', 'Philodendron & Clean Greens Face Mask', '', 'inherit', 'closed', 'closed', '', '119-autosave-v1', '', '', '2020-02-28 15:23:02', '2020-02-28 15:23:02', '', 119, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/119-autosave-v1/', 0, 'revision', '', 0),
(488, 1, '2020-02-28 15:41:33', '2020-02-28 15:41:33', '<b>Adding a plant or two on a shelf is a good idea</b>, no it’s an excellent idea! Whether it’s a  prickly cactus, fleshy succulents or sculptural hanging plants – play around and see the magic unfold before your eyes. Since my shelf is a bit compact I’ve decided to dedicate a full shelf only for some decorative items and stuff all books on the other shelf. My current <b>mood is very earthy, balanced, vintage</b>. I chose my paddle plant and a cactus to add the green factor. I paired the plants with some vintage ceramics in earthy tones, a wooden candleholder and a few stones I’d collected during my visit to the volcano Vesuvius in Italy.', 'Plant Shelfie Prints (Set of 4)', 'Plant Shelfie Prints (Set of 4, frames not included) by Angela Staehling. This little set of gouache and pencil paintings captures Angela’s love of plants, coffee, and travel. The 5\" x 7\" prints from her Plant Life collection are printed on natural watercolor 100% cotton paper. She also sells each print individually for $15 (see individual listings).', 'inherit', 'closed', 'closed', '', '106-autosave-v1', '', '', '2020-02-28 15:41:33', '2020-02-28 15:41:33', '', 106, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/106-autosave-v1/', 0, 'revision', '', 0),
(489, 1, '2020-02-28 15:48:47', '2020-02-28 15:48:47', 'Sometimes blank note cards are just what you need to communicate your most heartfelt thoughts. Our collection will give you the creative freedom to tell your nearest and dearest whatever your heart desires from “I miss you” to “Congratulations!”\n\n&nbsp;\n\nWrite your sweetest sentiments whenever you wish with boxed note cards from PAPYRUS. With so many different styles and designs to choose from, you\'ll definitely find one that fits your taste. We believe in taking advantage of every opportunity to send a card and celebrate the joy of everyday! We want to remind you to embrace all that life has to offer and appreciate the little things.\n\n&nbsp;\n\nOur mission is to elevate everyday living and moments in that journey to become joyful events, visual statements, and objects of beauty that convey a sense of self and punctuate the way we experience life. You\'ll always be prepared to spread the love with our beautiful blank note cards. Little notes make life just a little sweeter. Make someone smile today with PAPYRUS.\n\n&nbsp;', 'Potted Plants Boxed Notes', 'Potted Plants Boxed Notes include 2 each of 4 plant-themed designs, and feature gold foil and matching envelopes.', 'inherit', 'closed', 'closed', '', '98-autosave-v1', '', '', '2020-02-28 15:48:47', '2020-02-28 15:48:47', '', 98, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/98-autosave-v1/', 0, 'revision', '', 0),
