(492, 1, '2020-02-28 15:49:43', '2020-02-28 15:49:43', 'A <b>coaster</b>, <b>drink coaster</b>, <b>beverage coaster</b>, or <b>beermat</b> is an item used to rest <a title=\"Drink\" href=\"https://en.wikipedia.org/wiki/Drink\">drinks</a> upon. Coasters protect the surface of a <a title=\"Table (furniture)\" href=\"https://en.wikipedia.org/wiki/Table_(furniture)\">table</a> or any other surface where the user might place a drink. Coasters placed on top of a beverage can also be used to show that a drink is not finished or to prevent contamination (usually from insects). Coasters can also stop hot drinks burning the table surface.', 'Illustrated Coaster Set', 'Coaster Set by Angela Staehling. This coaster set features six assorted round coasters with cork backing, are heat and water resistant, and will withstand years of use. Packaged within a beautiful gold hot foil stamped box, this set is ideal for gifting.', 'inherit', 'closed', 'closed', '', '101-autosave-v1', '', '', '2020-02-28 15:49:43', '2020-02-28 15:49:43', '', 101, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/101-autosave-v1/', 0, 'revision', '', 0),
(493, 1, '2020-02-28 15:59:52', '2020-02-28 15:59:52', 'Apps aren\'t everything. Despite the plethora of to-do apps and note-taking apps available, pen and paper can still be a valuable productivity tool. In fact, paper note-taking and task management systems have <a href=\"https://newrepublic.com/article/134486/humble-notebook-flourishing-iphone-era?utm_source=zapier.com&amp;utm_medium=referral&amp;utm_campaign=zapier\" rel=\"noopener noreferrer nofollow\">been experiencing a revival in recent years</a>, as we grwith technology taking over our lives and try to avoid the distractions the internet offers.\n\nYou don\'t necessarily have to choose one approach or the other. Both apps and paper notebooks have particular advantages, and it\'s possible to combine them into one awesome, productivity-producing system of your own.', 'Weekly Planner and Note Cards', '<p class=\"product__description\">Weekly Planner + Note Cards by Angela Staehling. This weekly planner features 55 easy tear-off sheets to let you plan your year, one week at a time. This dateless notepad includes an attachable magnetic strip. Pad measures 9\" x 6-1/4\". Note cards are packaged in a clear protective plastic box and include 10 blank note cards and 10 white envelopes. Card size is 4.125\" x 5.5\".</p>', 'inherit', 'closed', 'closed', '', '100-autosave-v1', '', '', '2020-02-28 15:59:52', '2020-02-28 15:59:52', '', 100, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/100-autosave-v1/', 0, 'revision', '', 0),
(494, 1, '2020-02-28 16:01:53', '2020-02-28 16:01:53', 'Sweetheart hoya plant is a type of Hoya appropriately named for its thick, succulent, heart-shaped leaves. Like other Hoya varieties, sweetheart hoya plant is a stunning, low-maintenance indoor plant. Read on for additional wax plant info. Hoya Wax Plant Info Native to Southeast Asia, sweetheart hoya (Hoya kerrii) is often a quirky Valentine’s Day gift with a single 5-inch leaf planted upright in a small pot. Although the plant is relatively slow-growing, it appreciates a hanging basket, where it eventually becomes a bushy mass of green hearts. Mature plants can reach lengths of up to 13 feet. During the summer, clusters of white, burgundy-centered blooms provide bold contrast to the deep green or variegated leaves. One mature plant can display up to 25 blooms.\n\nRead more at Gardening Know How: Care Of Sweetheart Hoya Plant: Growing Valentine Hoya Houseplants <a href=\"https://www.gardeningknowhow.com/houseplants/sweetheart-hoya/sweetheart-hoya-plant-care.htm\">https://www.gardeningknowhow.com/houseplants/sweetheart-hoya/sweetheart-hoya-plant-care.htm</a>', 'Hoya Heart Plant', 'This Hoya kerrii cutting is commonly referred to as the Hoya Heart because of its heart-shaped leaf. The leaf is partially rooted.', 'inherit', 'closed', 'closed', '', '90-autosave-v1', '', '', '2020-02-28 16:01:53', '2020-02-28 16:01:53', '', 90, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/90-autosave-v1/', 0, 'revision', '', 0),
