(496, 1, '2020-02-28 18:04:43', '2020-02-28 18:04:43', 'Once you have <b>the gift card</b> number (or as much information as you <b>can find</b>), call customer service for <b>the</b> merchant that issued <b>the gift card</b>. ... <b>The</b> objective of <b>the</b> phone call is not to “<b>find</b>” <b>the gift card</b>, but to <b>find out</b> if <b>the gift card</b> has been <b>used</b>.', 'Digital Gift Card', 'Can’t decide? Give the gift of their choosing with a Digital Gift Card. Our e-gift is delivered by email with instructions on how to redeem. Forward to the recipient directly from your e-mail inbox, or replace your email with theirs during checkout. No additional processing or shipping fees. <a href=\"https://www.thesill.com/pages/gift-card-terms-conditions\">Find gift card T&amp;C\'s here.</a>', 'inherit', 'closed', 'closed', '', '89-autosave-v1', '', '', '2020-02-28 18:04:43', '2020-02-28 18:04:43', '', 89, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/89-autosave-v1/', 0, 'revision', '', 0),
