(498, 1, '2020-02-28 18:18:39', '2020-02-28 18:18:39', 'Using self-watering containers can be the best way to grow some plants. Plant health increases by providing a consistent level of moisture directly to the roots of plants. Probably the most common mistakes gardeners make is to <a href=\"https://www.thespruce.com/watering-plants-in-containers-847785\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"internalLink\" data-ordinal=\"1\">over-water plants</a>. With a well-designed self-watering container, the plants will get just the amount of water they need to thrive.\n\nA <b>can</b> is a container (typically made of plastic or metal) that has a spout at the end, with a bulbed nozzle with holes on it. It allows even distribution of <b>water</b> over a plant. The <b>watering can</b> is thus used to well, <b>water</b> plants.\n\n<b>Standard Can</b> stands 13 inches tall, 17 inches long, and holds 2 gallons of water.\n\n&nbsp;', 'Watering Can', 'Small BPA-free plastic watering can in green with long stem spout to control water flow. Holds 56 oz of water (about 1/2 gallon). Great for watering indoor plants but durable enough for outdoor use as well. Embossed with leafy plant motif. Made in the USA.', 'inherit', 'closed', 'closed', '', '85-autosave-v1', '', '', '2020-02-28 18:18:39', '2020-02-28 18:18:39', '', 85, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/85-autosave-v1/', 0, 'revision', '', 0),
(499, 1, '2020-02-28 18:28:15', '2020-02-28 18:28:15', 'If you have a Grandma that loves gardening or being outside, this is THE BEST Mothers day gift that she can get. An adorable plant stick that will remind her over and over again just how much you love and adore her. This hand scripted stick is designed for planters, but can also be stuck into a cake or dessert of choice too. These sticks are made from 1/8 thick beautiful birchwood.\n\nMake any <em>plant</em> a gift with the right <em>message</em>. Personalize your gift by choosing between six <em>messages</em> screen printed in black on 3 different shapes.', 'Ceramic Message Pops', '<p class=\"product__description\">Make any plant a gift with the right message. Personalize your gift by choosing between six messages screen printed in black on 3 different shapes. Ceramic head measuring 1.37\" tall is attached to wooden stick measuring about 4.3\" tall. Message Pop is packaged separately to protect pop and plant during transit.</p>', 'inherit', 'closed', 'closed', '', '81-autosave-v1', '', '', '2020-02-28 18:28:15', '2020-02-28 18:28:15', '', 81, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/81-autosave-v1/', 0, 'revision', '', 0),
(500, 1, '2020-02-28 18:40:21', '2020-02-28 18:40:21', 'Wood plant stand brings that extra flair to your indoor plants.\r\n\r\nThese hand crafted plant stands are crafted and designed to bring a modern bohemian touch to your home. Oh, and did we mention these are environmentally friendly, too? What a deal!\r\n\r\nWe offer several sizes and stains.\r\n\r\nGorgeous, modern plant stand for any room. Wood legs and 8 inch white ceramic planter included. The stand pictured is 25.5 inches from the bottom to the top of the white planter. Planter is 8 inches and full diameter of stand is 11.5 inches. We are always happy to build for custom dimensions, so just leave a note in the personalization if you want a different height or diameter.', 'Plant Stand', 'Our classic mid century Plant Stand is made from eco-friendly rubberwood, a light-colored tropical hardwood from the Pará rubber tree. It has a clear top coating and measures 14.3\" wide by 17.3\" tall (wood is .9\" thick). Fits 12\" diameter planter. Ships flat.', 'inherit', 'closed', 'closed', '', '79-autosave-v1', '', '', '2020-02-28 18:40:21', '2020-02-28 18:40:21', '', 79, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/79-autosave-v1/', 0, 'revision', '', 0),
(501, 1, '2020-03-03 12:06:31', '2020-03-03 12:06:31', 'An <b>angel wing begonia</b> houseplant blooms in clusters of flowers if located in the right area. Large clusters in a range of white, orange, pink or red appear on the happy <b>angel wing begonia</b> houseplant.\n\nBy far the best-known, grow on upright stems with interesting leaves and magnificent displays of a pendant and drooping flowers. The dragon wing begonia, another beauty, also belongs in this category. In terms of culture, these are not particularly difficult to grow and can thrive <a class=\"CMY_Link CMY_Valid\" href=\"https://www.thespruce.com/growing-begonias-indoors-1902479\" data-component=\"link\" data-source=\"inlineLink\" data-type=\"internalLink\" data-ordinal=\"2\">indoors</a>, providing you meet a few basic requirements.', 'Faux Angel Wings Begonia', 'The trendy angel wing begonia can be hard to find and even harder to keep alive. Opt for our artificial version instead. Pair it with one of our ceramic pots for a realistic look.', 'inherit', 'closed', 'closed', '', '74-autosave-v1', '', '', '2020-03-03 12:06:31', '2020-03-03 12:06:31', '', 74, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/74-autosave-v1/', 0, 'revision', '', 0),
(502, 1, '2020-02-28 18:48:15', '2020-02-28 18:48:15', 'The Money Tree is also called the “Good Luck Tree” and is an age-old token of good luck and an invitation to good fortune. It creates positive energy and rumored to bring prosperity and wealth to your surroundings. Resilient and does not require much care. The Money Tree is hardy and extremely tolerant of low light and dryness.\n\n<b>Should</b> not be over-watered, two to three times a month is sufficient. It is permissible to allow the top layer of soil to dry out to about an inch in between waterings.', 'Money Tree Plant', 'The Money Tree is a popular houseplant because of its resilience, ease of growth, and fun braided trunk.', 'inherit', 'closed', 'closed', '', '64-autosave-v1', '', '', '2020-02-28 18:48:15', '2020-02-28 18:48:15', '', 64, 'http://localhost/zh-wp-projects/zheshop/2020/02/28/64-autosave-v1/', 0, 'revision', '', 0),
(504, 1, '2020-02-28 19:23:33', '2020-02-28 19:23:33', 'With the purchase you will receive a guarantee card.', 'Gingko Leaf Earrings', 'These earrings are inspired by the leaf of the Ginkgo tree. 14k gold or sterling silver fill. Sold as a pair. Each earring measures 2\" x 2\". All items are hand made to order, thus each varies slightly and is beautiful in its own way.', 'publish', 'open', 'closed', '', 'gingko-leaf-earrings', '', '', '2020-03-03 12:01:34', '2020-03-03 12:01:34', '', 0, 'http://localhost/zh-wp-projects/zheshop/?post_type=product&#038;p=504', 0, 'product', '', 0),
