(584, 1, '2020-03-01 13:36:07', '2020-03-01 13:36:07', '[et_pb_section fb_built=\"1\" _builder_version=\"3.22.7\" background_size=\"initial\" background_position=\"top_center\"][et_pb_row _builder_version=\"3.22.7\"][et_pb_column type=\"4_4\" _builder_version=\"3.22.7\"][et_pb_text admin_label=\"Text\" _builder_version=\"3.22.7\" module_class=\"aboutus-mainheading\"]<h3>We will be known by the greens we leave behind</h3>\n[/et_pb_text][et_pb_image src=\"http://localhost/zh-wp-projects/zheshop/wp-content/uploads/2020/03/aboutus-bg.jpg\" _builder_version=\"3.22.7\"][/et_pb_image][et_pb_text _builder_version=\"3.22.7\"]<h4 class=\"module--text-block__title small small--bold col col-sm-6 col-md-6 col-lg-6\">Plants Make People Happy</h4>\n<p>This simple idea was the seed for what would become The Zheshop: a modern plant destination for the modern plant lover.</p>\n<p>Plants make us happier, healthier, more efficient and boost our creativity. They even clean the air we breathe. But all our modern city-living has us indoors a lot. So we thought: why not bring the outdoors in? We think everyone deserves to have their own personal plant oasis.</p>\n<p>And, we think finding your new plant should be, well, easy.</p>\n<h4 class=\"module--text-block__title small small--bold col col-sm-6 col-md-6 col-lg-6\">Welcome to Plant Parenthood</h4>\n<p>Take it from us, the plant category is difficult to navigate, especially as our shopping behaviors and expectations evolve. Our solution? Take the best parts of grandma’s garden supply center (the plants) and create a seamless shopping experience (without getting your hands too dirty).</p>\n<p>We started exclusively online, delivering potted houseplants like pizza to doorsteps all over Pakistan. In Islamabad, Lahore and KPK, our brick and mortar stores offer an escape from the concrete jungle, where we put our plants on display year-round and host weekly workshops. It’s quickly becoming everyone’s happy place.</p>\n<p>Every plant from The Zhes comes with simple care instructions, direct access to our team of houseplant experts, and our guarantee to be there every step of the way. Our goal is to make the experience of being a plant parent as wonderful as the plants themselves. We’re here to inspire confidence in the next generation of plant parents.</p>[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2020-03-01 17:04:03', '2020-03-01 17:04:03', '', 0, 'http://localhost/zh-wp-projects/zheshop/?page_id=584', 0, 'page', '', 0),
